import React from 'react';


const Header = () => {

  return (
    <header className="header">
      <div className="page_title">
      <h1>Daniel Bradley</h1>
      </div>
      <div class="container">
        <nav class="navbar navbar-collapse navbar-light">
            <div className="container-fluid d-flex justify-content-end">
                <a className="navbar-brand" href="/about">About</a>
                <a className="navbar-brand" href="/portfolio">Portfolio</a>
                <a className="navbar-brand" href="/resume">Resume</a>
                <a className="navbar-brand" href="/contact">Poo</a>
            </div>
        </nav>
    </div>
    </header>
  );
};



export default Header;
